/** base64 spectre color encoded */
	var Image = require('image');
    var base64 = "data:image/jpg;base64, ";

    var matrice;
    var img = new Image();
    var mapColor = [];
    img.isLoaded = false;
    img.src = base64;
    img.onload = function(){
        img.isLoaded = true;

        var canvas = document.createElement("canvas");
        canvas.width = img.width;
        canvas.height = img.height;

        matrice = canvas.getContext('2d');
        matrice.drawImage(img, 0, 0);

        for( var i = 0, l = matrice.canvas.height; i<l; i++ ){
            mapColor.push(matrice.getImageData(0, i, matrice.canvas.width, 1));
        }


    };

    var ColorMapping = function(){
        this.xRatio = 0;
        this.yRatio = 0;
    };

    ColorMapping.prototype.setReferences = function(itemWidth, itemHeight, gridWidth, gridHeight){
        this.xRatio = gridWidth/itemWidth;
        this.yRatio = gridHeight/itemHeight;
    };

        /**
     *
     * @param x
     * @param y
     * @returns {*}
     */
    ColorMapping.prototype.getColorPosition = function(x, y, number){

        var defaultColor = 0x000000;

        if( !img.isLoaded ){
            return defaultColor;
        }

        if( mapColor.length && !mapColor[y] ){
            return;
        }

        var r1 = mapColor[y].data[x*4];
        var g1 = mapColor[y].data[x*4+1];
        var b1 = mapColor[y].data[x*4+2];

        if( !r1 || !g1 || !b1 ){
            return defaultColor;
        }

        var hex = _rgbToHex(r1,g1,b1);

        return hex;
    };

    /**
     *
     * @param number
     * @returns {string}
     */
    ColorMapping.prototype.getColorByBoxNumber = function(number){
        var position = {x:0, y:0};

        var xRatio = this.xRatio;
        var yRatio = this.yRatio;

        var x = Math.round(number%xRatio);
        var y = Math.round(number/yRatio);

        position.x = x/this.xRatio*matrice.canvas.width;
        position.y = y/this.yRatio*(matrice.canvas.height-1);

        return "0x"+this.getColorPosition(Math.floor(position.x), Math.floor(position.y), number);
    };

    /**
     *
     * @param r
     * @param g
     * @param b
     * @returns {*}
     */
    ColorMapping.prototype.rgbToHex = function(r,g,b){
        return _rgbToHex(r,g,b);
    };

    function _componentToHex(c) {
        if( !c ){
            c = 0;
        }
        var hex = c.toString(16);
        return hex.length == 1 ? "0" + hex : hex;
    }

    function _rgbToHex(r, g, b) {
        return _componentToHex(r) + _componentToHex(g) + _componentToHex(b);
    }
    module.exports = new ColorMapping();